  false,\n\t\"url\": null,\n\t\"notes\": \"This 2' gravity density grid for Mexico,
  North-Central America, and the Western Caribbean Sea shows the distribution of about
  one million terrestrial and marine gravity measurements held in the NGS database
  as of March 1997. These gravity measurements have been augmented by data contributions
  from NGA (former National Imagery and Mapping Agency), and satellite altimeter-derived
  gravity anomalies computed by Sandwell and Smith (1997). This density grid shows
  the number of gravity data contained in a 2' x 2' cell. Please note that this coverage
  grid does not show the 15'x15' EGM96 gravity values used to fill the void areas
  south of 20 degrees North. Additional information is available at: http://www.ngs.noaa.gov/GEOID/MEXICO97
  .We are particularly grateful to NGA (former National Imagery and Mapping Agency)
  for their assistance and their data contributions.\",\n\t\"license_title\": null,\n\t\"extras\":
